import Vue from 'vue'
import VueRouter from 'vue-router'
import Home from './components/HomePage.vue'

import firebase from 'firebase'
import 'firebase/auth'
import  initializeApp from 'firebase/app'


//import { firebaseConfig } from './firebaseConfig'


import App from './App.vue'
import StartPage from './components/StartPage.vue'



var firebaseConfig = {
  apiKey: "AIzaSyCNCE5iXAu8JpR8NSKT64r6kc4urYytLUk",
  authDomain: "quiz-4c5de.firebaseapp.com",
  projectId: "quiz-4c5de",
  storageBucket: "quiz-4c5de.appspot.com",
  messagingSenderId: "627092607715",
  appId: "1:627092607715:web:821f5342cf4ab7875aabd6",
  measurementId: "G-29BCY7HZBM"
};


firebase.initializeApp(firebaseConfig);
//export { firebaseConfig }

Vue.use(VueRouter)

const router = new VueRouter({
  routes: [
    { path: '/', component: StartPage },
    { path: '/home', component: Home },
  ],
  mode: 'history'
})

new Vue({
  router,
  el: '#app',
  render: h => h(App),
  created() {
    firebase.initializeApp(firebaseConfig)
    firebase.auth().onAuthStateChanged(user => {
      if (user) {
        this.$router.push('/home')
      } else {
        this.$router.push('/start')
      }
    })
  }
})
